import React,{ Component, Fragment } from "react";
import { SideBar } from "../Directives/side-bar";
import { Carousel } from "../Directives/Carousel";

export class HomeComponent extends Component{
   constructor(props:any)
   {
    super(props);
   }
    
render()
{
    return (
       <Fragment>
           <SideBar></SideBar>
<Carousel></Carousel>


       </Fragment>
    )
}

}
